/**
 * Decodes the json listing of all fonts that comes from the Google WebFonts API
 *
 * Use this URL to get the json file https://www.googleapis.com/webfonts/v1/webfonts?key=AIzaSyB7JMGpC3uyoLm6XfFIU3rSndRQnnfr27M
 *
 * Then after using this function, update the array 
 * contents for function bfi_get_googlefonts()
 *
 * @package API\Utility
 * @internal This is only used to update the Google WebFont list of bfi_get_googlefonts()
 * @param string $json the json text from Google
 * @return array list of all webfonts
 */
function bfi_get_googlefonts_from_json($json) {
    $allFonts = array();

    $res = json_decode($json);
    foreach ($res->items as $item) {
        $fontName = urlencode($item->family);
        $fontFamily = $item->family;
        foreach ($item->variants as $variant) {
            $variantName = "";
        
            $fontWeight = "normal";
            if (preg_match('#^\d+#', $variant, $matches)) {
                if (count($matches)) {
                    $fontWeight = $matches[0];
                    switch ($fontWeight) {
                        case '100':
                            $variantName = __("Ultra-light", BFI_I18NDOMAIN);
                            break;
                        case '200':
                            $variantName = __("Light", BFI_I18NDOMAIN);
                            break;
                        case '300':
                            $variantName = __("Book", BFI_I18NDOMAIN);
                            break;
                        case '500':
                            $variantName = __("Medium", BFI_I18NDOMAIN);
                            break;
                        case '600':
                            $variantName = __("Semi-Bold", BFI_I18NDOMAIN);
                            break;
                        case '700':
                            $variantName = __("Bold", BFI_I18NDOMAIN);
                            break;
                        case '800':
                            $variantName = __("Extra-Bold", BFI_I18NDOMAIN);
                            break;
                        case '900':
                            $variantName = __("Ultra-Bold", BFI_I18NDOMAIN);
                            break;
                        default:
                            $variantName = __("Regular", BFI_I18NDOMAIN);
                    }
                }
            }
        
            $fontStyle = "normal";
            if (preg_match('#italic$#', $variant)) {
                $fontStyle = "italic";
                $variantName .= $variantName ? " Italic" : "Italic";
            }
        
            $fontValue = "$fontName:$variant";
            $fontLabel = "$fontFamily".($variantName ? " ($variantName)" : "");
        
            $css = "font-family: \\\"$fontFamily\\\", Helvetica, serif !important;";
            if ($fontWeight) {
                $css .= "font-weight: $fontWeight !important;";
            }
            if ($fontStyle) {
                $css .= "font-style: $fontStyle !important;";
            }
        
            $allFonts[$fontValue] = array(
                "label" => $fontLabel,
                "css" => $css,
                "subsets" => $item->subsets,
            );
        }
    }    
    
    // echo out the font array so we can update the array below
    echo "\$fonts = array(\n";
    foreach ($allFonts as $key => $value) {
        $subsets = "";
        foreach ($value['subsets'] as $subset) {
            $subsets .= $subsets ? ", " : "";
            $subsets .= "\"$subset\"";
        }
        $subsets = $subsets ? "array($subsets)" : "";
        echo "    \"{$key}\" => array(\"label\" => \"{$value['label']}\", \"css\" => \"{$value['css']}\", \"subsets\" => $subsets),\n";
    }
    echo ");";
    
    return $allFonts;
}


